import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import Header from '../sharedpages/header';
import Navbar from '../sharedpages/navbar';
import Footer from '../sharedpages/footer';
import './user.css';

const User = () => {
  const [activeTab, setActiveTab] = useState('dashboard');
  const navigate = useNavigate();
  
  // Get user type from localStorage
  const userType = localStorage.getItem('userType') || 'free';



  const bookmarkedAddresses = [
    { id: 1, address: '123 Jurong East Ave 1' },
    { id: 2, address: '456 Tuas South Ave 2' }
  ];

  const predictions = [
    {
      id: 1,
      name: 'B2 Warehouse, Jurong East',
      estimatedValue: '$2.9M',
      image: 'https://images.unsplash.com/photo-1586528116311-ad8dd3c8310d?w=300&h=200&fit=crop'
    },
    {
      id: 2,
      name: 'Factory Building, Tuas',
      estimatedValue: '$1.5M',
      image: 'https://images.unsplash.com/photo-1560472354-b33ff0c44a43?w=300&h=200&fit=crop'
    }
  ];

  const recommendedProperties = [
    {
      id: 1,
      name: 'Office Space, Central Business District',
      estimatedValue: '$5.2M',
      image: 'https://images.unsplash.com/photo-1497366216548-37526070297c?w=300&h=200&fit=crop'
    },
    {
      id: 2,
      name: 'Retail Unit, Orchard Road',
      estimatedValue: '$3.8M',
      image: 'https://images.unsplash.com/photo-1441986300917-64674bd600d8?w=300&h=200&fit=crop'
    }
  ];

  const comparisons = [
    {
      id: 1,
      name: 'Jurong East vs. Tuas',
      description: 'Property comparison analysis',
      address1: '123 Jurong East Ave 1',
      address2: '456 Tuas South Ave 2'
    }
  ];

  // Handler functions for view buttons
  const handleBookmarkedAddressView = (address) => {
    // Navigate to price prediction with the address
    navigate('/dashboard/price-prediction', { 
      state: { 
        prefillAddress: address,
        fromBookmark: true 
      } 
    });
  };

  const handleComparisonView = (comparison) => {
    // Navigate to comparison prediction with the comparison data
    navigate('/dashboard/compare-prediction', { 
      state: { 
        prefillComparison: comparison,
        fromBookmark: true 
      } 
    });
  };

  const handlePredictionView = (prediction) => {
    // Navigate to price prediction with the prediction data
    navigate('/dashboard/price-prediction', { 
      state: { 
        prefillAddress: prediction.name.split(',')[1]?.trim() || prediction.name,
        prefillPropertyType: prediction.name.split(',')[0]?.trim(),
        fromBookmark: true 
      } 
    });
  };





  return (
    <div className="user-dashboard">
      {/* Top Header */}
      <Header />

      <div className="user-dashboard-container">
        {/* Left Sidebar */}
        <Navbar activeTab={activeTab} setActiveTab={setActiveTab} />

        {/* Main Content */}
        <main className="user-main-content">
          <div className="user-content-header">
            <h1 className="user-main-title">User's Dashboard</h1>
            <p className="user-welcome-message">Welcome back, Amelia</p>
          </div>

          <div className="user-dashboard-sections">
                         {/* Bookmarked Addresses */}
             <section className="user-dashboard-section">
               <h2 className="user-section-title">Bookmarked Addresses</h2>
               <div className="user-address-list">
                 {bookmarkedAddresses.map((address) => (
                   <div key={address.id} className="user-address-item">
                     <span className="user-address-text">{address.address}</span>
                     <button 
                       className="user-view-btn"
                       onClick={() => handleBookmarkedAddressView(address.address)}
                     >
                       View
                     </button>
                   </div>
                 ))}
               </div>
             </section>

                         {/* Comparisons - Only for Premium Users */}
             {userType === 'premium' && (
               <section className="user-dashboard-section">
                 <h2 className="user-section-title">Comparisons</h2>
                 <div className="user-address-list">
                   {comparisons.map((comparison) => (
                     <div key={comparison.id} className="user-address-item">
                       <span className="user-address-text">{comparison.name}</span>
                       <button 
                         className="user-view-btn"
                         onClick={() => handleComparisonView(comparison)}
                       >
                         View
                       </button>
                     </div>
                   ))}
                 </div>
               </section>
             )}

                         {/* Predictions */}
             <section className="user-dashboard-section">
               <h2 className="user-section-title">Predictions</h2>
               <div className="user-property-grid">
                 {predictions.map((property) => (
                   <div key={property.id} className="user-property-card">
                     <div className="user-property-info">
                       <h3 className="user-property-name">{property.name}</h3>
                       <p className="user-property-value">Estimated Value: {property.estimatedValue}</p>
                     </div>
                     <div className="user-property-image">
                       <img src={property.image} alt={property.name} />
                     </div>
                     <button 
                       className="user-view-btn"
                       onClick={() => handlePredictionView(property)}
                     >
                       View
                     </button>
                   </div>
                 ))}
               </div>
             </section>

                         {/* Recommended Properties */}
             <section className="user-dashboard-section">
               <h2 className="user-section-title">Properties you might be interested in:</h2>
               <div className="user-property-grid">
                 {recommendedProperties.map((property) => (
                   <div key={property.id} className="user-property-card">
                     <div className="user-property-info">
                       <h3 className="user-property-name">{property.name}</h3>
                       <p className="user-property-value">Estimated Value: {property.estimatedValue}</p>
                     </div>
                     <div className="user-property-image">
                       <img src={property.image} alt={property.name} />
                     </div>
                     <button 
                       className="user-view-btn"
                       onClick={() => handlePredictionView(property)}
                     >
                       View
                     </button>
                   </div>
                 ))}
               </div>
             </section>
          </div>
        </main>
      </div>

      {/* Footer */}
      <Footer />
    </div>
  );
};

export default User;
